import * as React from 'react';
import LinearProgress, { linearProgressClasses } from '@mui/material/LinearProgress';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Stack from '@mui/material/Stack';
import { useTheme } from '@mui/material/styles';
import MobileStepper from '@mui/material/MobileStepper';
import Stepper from '@mui/material/Stepper';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';
import {Link} from "react-router-dom";

function Survey() {
  const theme = useTheme();
  const [activeStep, setActiveStep] = React.useState(0);

  const handleNext = () => {
  setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleBack = () => {
  setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const renderStep = () => {
      let content = null;
      switch (activeStep) {
          case 0:
            content = (
                <div className="p-8">
                    <div className="m-8">Ïù¥ÎØ∏ÏßÄÎ•º ÎßåÎì§Í∏∞ Ï†ÑÏóê, Î™áÍ∞ÄÏßÄ ÏßàÎ¨∏ÏùÑ ÏãúÏûëÌï©ÎãàÎã§.</div>
                </div>
            );
            break;
          case 1:
            content = (
              <div className="p-lr-8">
                  <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="Î∏åÎûúÎìúÎ™Ö ÏûÖÎ†•" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">ÌôïÏù∏</Button>
                  </Stack>
              </div>
            );
            break;
          case 2:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="Î∏åÎûúÎìúÎ™Ö ÏùòÎØ∏ ÏûÖÎ†•" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">ÌôïÏù∏</Button>
                  </Stack>
                </div>
              );
            break;
          case 3:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="ÏóÖÏ¢Ö ÏûÖÎ†•" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">ÌôïÏù∏</Button>
                  </Stack>
                </div>
              );
            break;
          case 4:
            content = (
              <div className="p-lr-8">
                  <Stack direction="row">
                  <Box
                    component="form"
                    sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                    noValidate
                    autoComplete="off">
                    <TextField id="standard-basic" label="Í¥ÄÎ†® ÎπÑÏ¶àÎãàÏä§ ÏûÖÎ†•" variant="standard" />
                  </Box>
                  <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">ÌôïÏù∏</Button>
                </Stack>
              </div>
            );
          break;
          case 5:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="ÏõêÌïòÎäî Î°úÍ≥† Î∂ÑÏúÑÍ∏∞" variant="standard" />
                    </Box>
                    <Button className="surveyBt" onClick={handleNext} variant="contained" color="babyblue">ÌôïÏù∏</Button>
                  </Stack>
                </div>
              );
            break;
          case 6:
            content = (
              <div className="p-8">
                <div className="m-8">ÏõêÌïòÎäî Ïä§ÌÉÄÏùºÏùÑ ÏÑ†ÌÉùÌï¥Ï£ºÏÑ∏Ïöî!</div>
                  <Stack direction="row">
                  <Button className="surveyBt" variant="contained" color="babyblue">ÏôÑÎ£å!</Button>
                </Stack>
              </div>
            );
          break;
        default:
          content = <div>Error</div>;
          break;
      }
      return content;
    };

  return (
    <div className="parent">
      <div className="child">
        <div className="survey">
          <MobileStepper
            variant="progress"
            steps={7}
            position="static"
            activeStep={activeStep}
            sx={{ flexGrow: 1 }}
            nextButton={
              <Button size="small" onClick={handleNext} disabled={activeStep === 6}>
                Next
                {theme.direction === 'rtl' ? (
                  <KeyboardArrowLeft />
                ) : (
                  <KeyboardArrowRight />
                )}
              </Button>
            }
            backButton={
              <Button size="small" onClick={handleBack} disabled={activeStep === 0}>
                {theme.direction === 'rtl' ? (
                  <KeyboardArrowRight />
                ) : (
                  <KeyboardArrowLeft />
                )}
                Back
              </Button>
            }
          />
          {renderStep()}
        </div>
      </div>
    </div>

    /*<div className="parent">
        <div className="child">
            <div className="survey text-center">
                <div className="progress-div"></div>
                <div className="content-div">
                    <h1>Î°úÍ≥† ÎßåÎì§Í∏∞Î•º ÏãúÏûëÌï¥ Î≥¥ÏÑ∏Ïöî!</h1>
                    <span className="description-span">ÏßàÎ¨∏Ïóê Îãµ Ìï¥Î≥¥ÏÑ∏Ïöî, Î∏åÎûúÎìúÏùò ÌäπÏßïÏù¥ Ïûò ÏÇ¥Î†§ÏßÑ Î°úÍ≥† ÎîîÏûêÏù∏ÏùÑ ÏÑ†Î¨ºÌï¥ ÎìúÎ¶¥Í≤åÏöî üòä !</span>
                </div>
                <div className="button-div">
                    <Link to={"/Survey"}>
                        <Button className="startBt f-right" variant="contained" color="pupleblue">START</Button>
                    </Link>
                </div>
            </div>
        </div>
    </div>*/
  );
}

export default Survey;
